import React from "react";

function Footer() {
  return (
    <div>
      <div className="row">
        <div className="col-md-12">
          <div className="footer p-2 mt-4 text-center bg-light text-dark">
            Created By@
            <span className="text-success font-weight-normal">
              Ashish & Manish
            </span>{" "}
            for Capstone Project
          </div>
        </div>
      </div>
    </div>
  );
}

export default Footer;
